import React from "react";
import "./UserProfile.css";

type UserProfileProps = {
  username: string;
  avatarUrl?: string;
  interests: string[];
  residence?: string;
  streak?: number;
  connections?: number;
};

const UserProfile: React.FC<UserProfileProps> = ({
  username,
  avatarUrl,
  interests,
  residence,
  streak,
  connections,
}) => {
  return (
    <div className="user-profile">
      <div className="profile-header">
        <img
          src={src}
          alt="User Avatar"
          className="avatar"
        />
        <h2>{username}</h2>
      </div>

      <div className="profile-section">
        <h3>Interests</h3>
        <ul className="interests">
          {interests.map((interest, idx) => (
            <li key={idx} className="interest-item">
              {interest}
            </li>
          ))}
        </ul>
      </div>

      {residence && (
        <div className="profile-section">
          <h3>Residence</h3>
          <p>{residence}</p>
        </div>
      )}

      <div className="profile-section">
        <h3>Stats</h3>
        <p>Streak: {streak || 0}</p>
        <p>Connections: {connections || 0}</p>
      </div>
    </div>
  );
};

export default UserProfile;
